import{_ as r,c as e,o as t,ah as o}from"./chunks/framework.Cz7uxNdR.js";const p=JSON.parse('{"title":"FAQ","description":"Часто задаваемые вопросы о Stuzhik. Решение проблем: OutOfMemoryError, краши, конфликты модов. Поддержка Forge, Fabric, NeoForge, Quilt.","frontmatter":{"description":"Часто задаваемые вопросы о Stuzhik. Решение проблем: OutOfMemoryError, краши, конфликты модов. Поддержка Forge, Fabric, NeoForge, Quilt.","head":[["meta",{"name":"keywords","content":"stuzhik faq, стужик, minecraft лаунчер проблемы, outofmemoryerror minecraft, краш minecraft моды, forge fabric quilt neoforge"}]]},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),i={name:"faq.md"};function l(n,a,h,d,s,c){return t(),e("div",null,[...a[0]||(a[0]=[o('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h1><h2 id="общие-вопросы" tabindex="-1">Общие вопросы <a class="header-anchor" href="#общие-вопросы" aria-label="Permalink to &quot;Общие вопросы&quot;">​</a></h2><h3 id="чем-отличается-от-других-лаунчеров" tabindex="-1">Чем отличается от других лаунчеров? <a class="header-anchor" href="#чем-отличается-от-других-лаунчеров" aria-label="Permalink to &quot;Чем отличается от других лаунчеров?&quot;">​</a></h3><p><strong>Анализ крашей:</strong> Находит виноватые моды и предлагает решения. Другие лаунчеры только показывают лог.</p><p><strong>Производительность:</strong> Быстрый запуск, малое потребление ресурсов.</p><p><strong>Live мониторинг:</strong> Отслеживает проблемы во время игры.</p><h3 id="поддерживается-ли-fabric-forge-neoforge-quilt" tabindex="-1">Поддерживается ли Fabric/Forge/NeoForge/Quilt? <a class="header-anchor" href="#поддерживается-ли-fabric-forge-neoforge-quilt" aria-label="Permalink to &quot;Поддерживается ли Fabric/Forge/NeoForge/Quilt?&quot;">​</a></h3><p>Да, все 4 загрузчика + Vanilla.</p><h3 id="можно-ли-использовать-с-существующими-экземплярами" tabindex="-1">Можно ли использовать с существующими экземплярами? <a class="header-anchor" href="#можно-ли-использовать-с-существующими-экземплярами" aria-label="Permalink to &quot;Можно ли использовать с существующими экземплярами?&quot;">​</a></h3><p>Да. Импорт из:</p><ul><li>MultiMC/Prism Launcher</li><li>Modrinth модпаки (.mrpack)</li><li>CurseForge модпаки (.zip)</li></ul><h3 id="требуется-ли-аккаунт-minecraft" tabindex="-1">Требуется ли аккаунт Minecraft? <a class="header-anchor" href="#требуется-ли-аккаунт-minecraft" aria-label="Permalink to &quot;Требуется ли аккаунт Minecraft?&quot;">​</a></h3><p>Да, нужно использовать Microsoft аккаунт с купленным Minecraft: Java Edition.</p><h2 id="производительность" tabindex="-1">Производительность <a class="header-anchor" href="#производительность" aria-label="Permalink to &quot;Производительность&quot;">​</a></h2><h3 id="почему-forge-устанавливается-долго" tabindex="-1">Почему Forge устанавливается долго? <a class="header-anchor" href="#почему-forge-устанавливается-долго" aria-label="Permalink to &quot;Почему Forge устанавливается долго?&quot;">​</a></h3><p>Forge installer загружает библиотеки с <code>maven.minecraftforge.net</code>. Это занимает 1-3 минуты.</p><p>Stuzhik использует зеркала BMCLAPI для ускорения.</p><h3 id="сколько-места-занимает-экземпляр" tabindex="-1">Сколько места занимает экземпляр? <a class="header-anchor" href="#сколько-места-занимает-экземпляр" aria-label="Permalink to &quot;Сколько места занимает экземпляр?&quot;">​</a></h3><table tabindex="0"><thead><tr><th>Компонент</th><th>Размер</th></tr></thead><tbody><tr><td>Minecraft</td><td>~200MB</td></tr><tr><td>Forge/Fabric</td><td>~50MB</td></tr><tr><td>Моды (10-50шт)</td><td>~100-500MB</td></tr><tr><td><strong>Итого</strong></td><td>~400-800MB</td></tr></tbody></table><h3 id="можно-ли-запустить-несколько-экземпляров-одновременно" tabindex="-1">Можно ли запустить несколько экземпляров одновременно? <a class="header-anchor" href="#можно-ли-запустить-несколько-экземпляров-одновременно" aria-label="Permalink to &quot;Можно ли запустить несколько экземпляров одновременно?&quot;">​</a></h3><p>Да, без ограничений.</p><h2 id="моды" tabindex="-1">Моды <a class="header-anchor" href="#моды" aria-label="Permalink to &quot;Моды&quot;">​</a></h2><h3 id="как-установить-мод" tabindex="-1">Как установить мод? <a class="header-anchor" href="#как-установить-мод" aria-label="Permalink to &quot;Как установить мод?&quot;">​</a></h3><p><strong>Вариант 1:</strong> Каталог</p><ol><li>Открой экземпляр → Моды → Каталог</li><li>Найди мод → Установить</li></ol><p><strong>Вариант 2:</strong> Файл</p><ol><li>Открой экземпляр → Моды</li><li>Кнопка &quot;Добавить&quot; или drag&amp;drop <code>.jar</code></li></ol><h3 id="stuzhik-автоматически-обновляет-моды" tabindex="-1">Stuzhik автоматически обновляет моды? <a class="header-anchor" href="#stuzhik-автоматически-обновляет-моды" aria-label="Permalink to &quot;Stuzhik автоматически обновляет моды?&quot;">​</a></h3><p>По умолчанию нет. Можно включить для каждого мода:</p><ol><li>Список модов → клик на мод</li><li>Включи &quot;Автообновление&quot;</li></ol><h3 id="что-делать-при-конфликте-модов" tabindex="-1">Что делать при конфликте модов? <a class="header-anchor" href="#что-делать-при-конфликте-модов" aria-label="Permalink to &quot;Что делать при конфликте модов?&quot;">​</a></h3><p>Stuzhik предупредит ДО установки если знает о конфликте.</p><p>Если краш уже произошёл:</p><ol><li>Анализатор логов → найдёт виновный мод</li><li>Кнопка &quot;Удалить мод&quot; или &quot;Заменить на совместимый&quot;</li></ol><h3 id="где-хранятся-моды" tabindex="-1">Где хранятся моды? <a class="header-anchor" href="#где-хранятся-моды" aria-label="Permalink to &quot;Где хранятся моды?&quot;">​</a></h3><p>На Windows:</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code" tabindex="0"><code><span class="line"><span>C:\\Users\\&lt;username&gt;\\AppData\\Roaming\\ru.sibxodev.stuzhik/instances/&lt;instance_id&gt;/mods/</span></span></code></pre></div><h2 id="проблемы" tabindex="-1">Проблемы <a class="header-anchor" href="#проблемы" aria-label="Permalink to &quot;Проблемы&quot;">​</a></h2><h3 id="outofmemoryerror" tabindex="-1">OutOfMemoryError <a class="header-anchor" href="#outofmemoryerror" aria-label="Permalink to &quot;OutOfMemoryError&quot;">​</a></h3><p><strong>Причина:</strong> Недостаточно RAM выделено.</p><p><strong>Решение:</strong></p><ol><li>Открой экземпляр → Edit</li><li>Увеличь RAM (рекомендуется 4-6GB для модпаков)</li><li>Сохрани → Перезапусти</li></ol><h3 id="игра-не-запускается" tabindex="-1">Игра не запускается <a class="header-anchor" href="#игра-не-запускается" aria-label="Permalink to &quot;Игра не запускается&quot;">​</a></h3><p><strong>Проверь:</strong></p><ol><li>Dev Console → есть ли ошибки?</li><li>Log Analyzer → найдёт проблему автоматически</li><li>Java установлена? (Stuzhik устанавливает автоматически, но может быть ошибка)</li></ol><h3 id="моды-не-загружаются" tabindex="-1">Моды не загружаются <a class="header-anchor" href="#моды-не-загружаются" aria-label="Permalink to &quot;Моды не загружаются&quot;">​</a></h3><p><strong>Для Forge:</strong></p><ul><li>Файл должен быть для Forge (в названии <code>-forge-</code>)</li><li>Версия Minecraft должна совпадать</li></ul><p><strong>Для Fabric:</strong></p><ul><li>Требуется Fabric API (устанавливается автоматически)</li><li>Файл для Fabric (в названии <code>-fabric-</code>)</li></ul><h3 id="краш-с-mixin" tabindex="-1">Краш с &quot;Mixin&quot; <a class="header-anchor" href="#краш-с-mixin" aria-label="Permalink to &quot;Краш с &quot;Mixin&quot;&quot;">​</a></h3><p><strong>Причина:</strong> Конфликт модов, модифицирующих одинаковый код.</p><p><strong>Решение:</strong></p><ol><li>Log Analyzer покажет конфликтующие моды</li><li>Удали один из конфликтующих</li><li>Или используй альтернативный мод</li></ol><h2 id="разработка" tabindex="-1">Разработка <a class="header-anchor" href="#разработка" aria-label="Permalink to &quot;Разработка&quot;">​</a></h2><p>Будет немного позже...</p>',56)])])}const f=r(i,[["render",l]]);export{p as __pageData,f as default};
